 /**
 * tzNameToIndex(): convert a time zone string to an index
 * 
 * @param _tz = time zone name string
 * 
 * @return index of time zone
 */
size_t GeoOps::tzNameToIndex ( const char* _tz ) {
    // if _tz match a timezone name, return the index
    if ( _tz == NULL || strlen(_tz) == 0 )
        return 0;
    
    for ( size_t i = 0; i < TIMEZONES_TOTAL; i++ ) {
        if ( strcmp( _tz, timezone_name[i] ) == 0 )
            return i;
    }

    return 0;
}

/**
 * tzIndexToName(): convert a time zone index to a string
 * 
 * @param _tzIndex = time zone index
 * 
 * @return time zone name string
 */
const char* GeoOps::tzIndexToName ( size_t _tzIndex ) {
    return ( _tzIndex < TIMEZONES_TOTAL )? timezone_name[_tzIndex] : "Unknown";
}

/**
 * tzOffsetInDays(): calculate time zone offset from Universal Time
 *                   in days for the spec'd time_t (includes DST)
 *
 * @param _tzIndex = time zone index
 *
 * @return Offset (-0.5 ... +0.5 )
 */

double GeoOps::tzOffsetInDaysST ( size_t _tzIndex ) {
    return (_tzIndex < TIMEZONES_TOTAL) ? double(timezone_offset[_tzIndex][0]) * TimeOps::DAYS_PER_SECOND : 0.0;
}

/**
 * tzOffsetInDaysDST(): calculate time zone offset from Universal Time
 *                   in days for the spec'd time_t (includes DST)
 * 
 * @param _tzIndex = time zone index
 * 
 * @return Offset (-0.5 ... +0.5 )
 */

double GeoOps::tzOffsetInDaysDST ( size_t _tzIndex ) {
    return (_tzIndex < TIMEZONES_TOTAL) ? double(timezone_offset[_tzIndex][1]) * TimeOps::DAYS_PER_SECOND : 0.0;
}

bool GeoOps::tzIsDST ( double _lat, int _month, int _day) {
    bool isDST = false;
    
    if ( _lat > 0 ) {
        // Northern Hemisphere
        if ( _month > 3 && _month < 11 ) {
            isDST = true;
        }
        else if ( _month == 3 ) {
            if ( _day >= 8 ) {
                isDST = true;
            }
        }
        else if ( _month == 11 ) {
            if ( _day < 1 ) {
                isDST = true;
            }
        }
    }
    else {
        // Southern Hemisphere
        if ( _month > 9 && _month < 4 ) {
            isDST = true;
        }
        else if ( _month == 9 ) {
            if ( _day >= 8 ) {
                isDST = true;
            }
        }
        else if ( _month == 4 ) {
            if ( _day < 1 ) {
                isDST = true;
            }
        }
    }
    
    return isDST;
}

double GeoOps::tzOffsetInDays( double _lat, int _month, int _day, size_t _tzIndex ) {    
    return tzIsDST(_lat, _month, _day) ? tzOffsetInDaysDST(_tzIndex) : tzOffsetInDaysST(_tzIndex);
}

// Get spherical distance between two points on the Earth's surface
double GeoOps::distance(double _lng1, double _lat1, double _lng2, double _lat2) {
    // Convert degrees to radians
    _lng1 = MathOps::toRadians(_lng1);
    _lat1 = MathOps::toRadians(_lat1);
    _lng2 = MathOps::toRadians(_lng2);
    _lat2 = MathOps::toRadians(_lat2);

    // Haversine formula
    double dLng = _lng2 - _lng1;
    double dLat = _lat2 - _lat1;
    double a = sin(dLat/2) * sin(dLat/2) + cos(_lat1) * cos(_lat2) * sin(dLng/2) * sin(dLng/2);
    double c = 2 * atan2(sqrt(a), sqrt(1-a));
    return EARTH_EQUATORIAL_RADIUS_KM * c;
}

double GeoOps::distance(const Geodetic& _g1, const Geodetic& _g2) {
    return distance(_g1.getLongitude(DEGS), _g1.getLatitude(DEGS), _g2.getLongitude(DEGS), _g2.getLatitude(DEGS));
}

size_t GeoOps::findClosestCity(double _lng, double _lat) {
    double minDist = 1e10;
    size_t minIndex = 0;
    bool found = false;
    for (size_t i = 0; i < CITIES_TOTAL; ++i) {
        double dist = distance(_lng, _lat, cities_loc[i][1] , cities_loc[i][0]);
        if (dist < minDist) {
            minDist = dist;
            minIndex = i;
            found = true;
        }
    }
    return minIndex;
}

size_t GeoOps::findClosestCity(const Geodetic& _g) {
    return findClosestCity(_g.getLongitude(DEGS), _g.getLatitude(DEGS));
}


